const logoImage = new Image();
logoImage.src = "data:image/png;base64,";


logoImage.addEventListener('load', ()=>{
    const canvaslogo = document.getElementById('canvas-logo');
    const ctxlogo = canvaslogo.getContext('2d');
    canvaslogo.width = 456;
    canvaslogo.height = 400;
    
    ctxlogo.drawImage(logoImage, 0, 0, canvaslogo.width, canvaslogo.height);
    ctxlogo.font = '48px Courier New';
    ctxlogo.fillStyle = 'white';
    ctxlogo.fillText("RSpiker", 200, 250);
    const pixels = ctxlogo.getImageData(0,0,canvaslogo.width, canvaslogo.height);
    ctxlogo.clearRect(0,0, canvaslogo.width, canvaslogo.height);

    let particleArray = [];
    const numberOfParticles = 3000;

    let mappedImage = [];
    for(let y = 0; y < canvaslogo.height; y++){
        let row = [];
        for(let x = 0; x < canvaslogo.width; x++){
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)]/100;
            const cell = [
                cellBrightness = red,
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    class Particle {
        constructor(){
            this.x = Math.random() * canvaslogo.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.9;
            this.size = Math.random() * 0.5 + 0.5;
            this.fX = Math.floor(this.x);
            this.fY = Math.floor(this.y);
        }

        update(){
            this.fX = Math.floor(this.x);
            this.fY = Math.floor(this.y);
            this.speed = mappedImage[this.fY][this.fX][0];
            this.y += (2.7 - this.speed) + this.velocity;
            if(this.y > canvaslogo.height){
                this.y = 0;
                this.x = Math.random() * canvaslogo.width;
            }
        }

        draw(){
            ctxlogo.beginPath();
            if(this.y > 215 && this.y < 260){
                ctxlogo.fillStyle = 'rgb(0,255,0)';
            }
            else{
                ctxlogo.fillStyle = 'white';
            }
            //ctxlogo.arc(this.x,this.y,this.size,0,Math.PI * 2);
            ctxlogo.fillRect(this.x, this.y, this.size, this.size);
        }
    }

    function init(){
        for(let i = 0; i < numberOfParticles; i++){
            particleArray.push(new Particle);
        }
    }

    init();

    function animate(){
        if(canvaslogo.offsetLeft != 0){
            ctxlogo.globalAlpha = 0.02;
            ctxlogo.fillStyle = 'rgb(0,0,0)';
            ctxlogo.fillRect(0,0, canvaslogo.width, canvaslogo.height);
            ctxlogo.globalAlpha = 0.2;
            for(let i = 0; i < particleArray.length; i++){
                particleArray[i].update();
                ctxlogo.globalAlpha = particleArray[i].speed * 0.3;
                particleArray[i].draw();
            }
        } 
        requestAnimationFrame(animate);
    }
    animate();

});
